TITLE:
  - test membrane active strain material for gastric electromechanics
  - 'at its core this is a one way coupled scatra to solid problem:'
  - 'depending on the oscillating scalar activation variable phi1,'
  - the 2 active fibers in the structural material create an
  - active strain contribution to the deformation gradient.
  - The formulation is fully incompressible due to membrane.
  - '- quadratic domain 5x5 dicretized by 10x10=100 quad4 elements'
  - '- volume matching meshes (scatra mesh is cloned from the solid mesh)'
  - '- solution of scalar reaction term is:'
  - 'phi(t|x,y) = K * sin(x+w*t) * sin(y+w*t) in [0,1]'
  - dphi/dt = K * w * (cos(x+w*t)*sin(y+w*t)+sin(x+w*t)*cos(y+w*t))
  - ddphi/dt^2 = K * w^2 * (-sin(x+w*t)*sin(y+w*t)+cos(x+w*t)*cos(y+w*t))
  - dddphi/dt^3 = -4 * w^2 * dphi/dt
  - '- where w=3, K=5/(2*pi)'
  - '- corresponding reaction formulation (system of ODEs with the above solution):'
  - dphi1/dt = phi2
  - dphi2/dt = phi3
  - dphi3/dt = -4 * w^2 * phi2
  - '- no-flux bc for scatra field'
  - '- initial conditions for scatra field are solution and derivatives at time 0'
  - '- no spatial coupling of scatra field'
  - '- material formulation and parameters for active strain material described in [2]'
  - '- active fibers align with x- and y-direction respectively'
  - '- activation of active strain material based on phi1'
  - '- DBC for structure field such that all displacements are restricted to the xy-plane'
  - '- DBC for structure field such that (at the boundary) only displacements parallel to the four boundary
    lines is allowed (in the xy-plane)'
  - '[2]: Brandstaeter, S. et al. (2018) ''Computational model of gastric motility with active-strain
    electromechanics'', ZAMM. Wiley-Blackwell. doi: 10.1002/zamm.201800166.'
